// src/components/Navbar.js
import React from 'react';
import styled from 'styled-components';
import { FaReact } from 'react-icons/fa';
import { Link } from 'react-router-dom'; // Import Link from react-router-dom

const Nav = styled.nav`
  background: #0b59de;
  height: 60px;
  display: flex;
  justify-content: space-between;
  padding: 0 20px;
  align-items: center;
  color: #fff;
  position: sticky;
  top: 0;
  z-index: 999;
`;

const NavLogo = styled(Link)` // Use Link for the logo to navigate to the home page
  color: #f2f2f2;
  display: flex;
  align-items: center;
  text-decoration: none;
  font-size: 24px;
`;

const NavMenu = styled.div`
  display: flex;
  gap: 20px;
`;

const NavItem = styled(Link)` // Use Link for navigation items
  color: #fff;
  text-decoration: none;
  &:hover {
    color: #de6e0b;
  }
`;

function Navbar() {
  return (
    <Nav>
      <NavLogo to="/"> {/* Use 'to' instead of 'href' for routing */}
        <FaReact style={{ marginRight: '10px' }} />
        CODEV
      </NavLogo>
      <NavMenu>
        <NavItem to="/">Home</NavItem>
        <NavItem to="/surface-selection">Surface Selection</NavItem>
        <NavItem to="/peptide-selection">Peptide Selection</NavItem>
        <NavItem to="/glossary">Glossary</NavItem>
        <NavItem to="/features">Features</NavItem>
        {/* <NavItem to="/contributors">Contributors</NavItem> */}
        <NavItem to="/contact">Contact us</NavItem>
      </NavMenu>
    </Nav>
  );
}

export default Navbar;
